import React  from "react"

const url = "http://localhost:8000/artists"
function Freelances() {
	const [post, setPost] = React.useState(null);

	React.useEffect(() => {
		axios.get(url).then((response) => {
			setPost(response.data);
		})
	}, [])
	if (post === null) {
        return <div>Loading...</div>;
    }

    console.log(post[1].bio)
    return(
        <div>
            <h1>{post}</h1>
        </div>
    )
}

